import React from "react";
import useStyles from "./profile.style";
import {ResumePicture} from "../../ResumeData/ResumeData";


function Profile() {
    const styles = useStyles();

    return (
        <Grid container spacing={2}>

            <Grid className={styles.profile} item xs={4}>
                <img src={ResumePicture} alt='sdasd'/>
                <div className={styles.profileSVG}>
                    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 571.662 477.291">
                        <path id="Path_1" data-name="Path 1" d="M375,692.814s28.865-155.221,132.865-93.436S742,564.112,806,503.911,945.12,534.284,945.12,534.284l1.542,426.266H375Z" transform="translate(-375 -483.26)" fill="#222b45" />
                    </svg>
                </div>

            </Grid>
            <Grid item xs={5}>
                fgdfg
            </Grid>

        </Grid>
    );
}

export default Profile;
